import { redirect } from "react-router-dom";

export const getToken = () => {
    const token = localStorage.getItem("token");
    if (!token) {
        return null
    }
    return token
}

export const logOut = () => {
    localStorage.removeItem('token');
    return redirect("/auth")
};
